campaignTrail_temp.questions_json = JSON.parse("[{\"model\": \"campaign_trail.question\", \"pk\": 717, \"fields\": {\"priority\": 1, \"description\": \"January 2021: The CDU has just elected Armin Laschet as their party leader. Politicians across the political spectrum are congratulating him. What do you want to say?\", \"likelihood\": 1.0}}, {\"model\": \"campaign_trail.question\", \"pk\": 718, \"fields\": {\"priority\": 1, \"description\": \"After Laschet’s election, you have privately made your decision that you want to become chancellor candidate, but decided to wait a bit longer until you announce it publicly. What do you want to focus on in the coming weeks?\", \"likelihood\": 1.0}}, {\"model\": \"campaign_trail.question\", \"pk\": 719, \"fields\": {\"priority\": 1, \"description\": \"March 2021: COVID-19 and the countermeasures against it have shaped the lives of people in Germany for the past years. Now that the winter is over, a lot of people are demanding an end to the harsh lockdowns. As Minister-President of Bavaria, you can shape the response in this state. What is your stance on this?\", \"likelihood\": 1.0}}, {\"model\": \"campaign_trail.question\", \"pk\": 720, \"fields\": {\"priority\": 1, \"description\": \"You’ve been invited to a talk show to talk about tax policy. Left-wing parties like the SPD and the Greens want to raise taxes, while the FDP wants to lower them. How do you want to frame the position of your party?\", \"likelihood\": 1.0}}, {\"model\": \"campaign_trail.question\", \"pk\": 721, \"fields\": {\"priority\": 1, \"description\": \"A report from the news magazine “Der Spiegel” has revealed that several CDU and CSU MPs have been implicated in corrupt dealings. They were part of a scheme to sell overpriced medical masks to government organizations. What is your reaction to this scandal?\", \"likelihood\": 1.0}}, {\"model\": \"campaign_trail.question\", \"pk\": 722, \"fields\": {\"priority\": 1, \"description\": \"April 2021: Olaf Scholz has been declared chancellor candidate by the SPD last year already and there are rumours the Green party is about to nominate someone as well soon. It’s clear that the CDU/CSU want to soon nominate someone as well. How do you want to go about challenging Laschet?\", \"likelihood\": 1.0}}, {\"model\": \"campaign_trail.question\", \"pk\": 723, \"fields\": {\"priority\": 1, \"description\": \"You and Laschet both want to become the chancellor candidate for the Union of CDU/CSU. Both of you have supporters and detractors within the party. How do you want to decide this?\", \"likelihood\": 1.0}}, {\"model\": \"campaign_trail.question\", \"pk\": 724, \"fields\": {\"priority\": 1, \"description\": \"You never really doubted this outcome - but it still feels good to become chancellor candidate finally. In your first speech, what do you want to focus on?\", \"likelihood\": 1.0}}, {\"model\": \"campaign_trail.question\", \"pk\": 725, \"fields\": {\"priority\": 1, \"description\": \"The Green party has, for the first time in its history, nominated a chancellor candidate, Rober Habeck. He appears to be your main contender, as she’s even ahead of you in some polls, while Olaf Scholz of the SPD is far behind in third place. What’s your strategy regarding your two contenders?\", \"likelihood\": 1.0}}, {\"model\": \"campaign_trail.question\", \"pk\": 726, \"fields\": {\"priority\": 1, \"description\": \"Michael Kretschmer, your party colleague and Minister-President of Saxony, has recently travelled to Moscow and has been criticized for that visit. Additionally, your own trip to Moscow last year is scrutinised by the media as well. What is your stance regarding Russia?\", \"likelihood\": 1.0}}, {\"model\": \"campaign_trail.question\", \"pk\": 727, \"fields\": {\"priority\": 1, \"description\": \"May 2021: The Federal Constitutional Court just ruled the Climate Protection Act unconstitutional and demands the government do more to lower emissions. The federal government in Berlin is now working on making the law stricter. Do you have a position on this?\", \"likelihood\": 1.0}}, {\"model\": \"campaign_trail.question\", \"pk\": 728, \"fields\": {\"priority\": 1, \"description\": \"More and more people are receiving a Covid vaccine, though it’s still not accessible to everyone. Do you have a comment on your ideas to move forward with the vaccination campaign?\", \"likelihood\": 1.0}}, {\"model\": \"campaign_trail.question\", \"pk\": 729, \"fields\": {\"priority\": 1, \"description\": \"You have been invited to talk about German foreign and defence policy. What talking points do you want to emphasise?\", \"likelihood\": 1.0}}, {\"model\": \"campaign_trail.question\", \"pk\": 730, \"fields\": {\"priority\": 1, \"description\": \"June 2021: As the campaign is heating up, Olaf Scholz and the SPD still struggle in the polls. Also,  the CDU was the big winner at the provincial elections in Saxony-Anhalt, with Minister-President Reiner Haseloff massively increasing the vote share of the CDU. Do you have a comment?\", \"likelihood\": 1.0}}, {\"model\": \"campaign_trail.question\", \"pk\": 731, \"fields\": {\"priority\": 1, \"description\": \"Digitalization is an important topic in this election, with all parties unveiling plans for how to move forward with this. What is the plan of the CDU?\", \"likelihood\": 1.0}}, {\"model\": \"campaign_trail.question\", \"pk\": 732, \"fields\": {\"priority\": 1, \"description\": \"July 2021: Widespread flooding is affecting large areas of western, southern and middle Germany. Bavaria is among the affected states and pictures of the destruction in other states dominate the news. What’s your immediate response?\", \"likelihood\": 1.0}}, {\"model\": \"campaign_trail.question\", \"pk\": 733, \"fields\": {\"priority\": 1, \"description\": \"Post-flood cleanup operations are going on as the full devastation of the flooding becomes clear. Many advisors urge you to get out and show yourself as a man of action.\", \"likelihood\": 1.0}}, {\"model\": \"campaign_trail.question\", \"pk\": 734, \"fields\": {\"priority\": 1, \"description\": \"Climate change is a much-discussed topic again after the floodings. You have been asked to clarify your stance on how to best combat climate change.\", \"likelihood\": 1.0}}, {\"model\": \"campaign_trail.question\", \"pk\": 735, \"fields\": {\"priority\": 1, \"description\": \"After early successes, the vaccination campaign has become sluggish in recent weeks. Some politicians are going so far as to demand making the vaccine mandatory.\", \"likelihood\": 1.0}}, {\"model\": \"campaign_trail.question\", \"pk\": 736, \"fields\": {\"priority\": 1, \"description\": \"August 2020: With the campaign heating up, there have been some attacks on you and your party - a big target is CSU Minister of Transportation Scheuer. The CSU had promised highway toll for foreigners after the last election, but the project failed, with many blaming Scheuer,  and still cost millions. Do you have a statement here?\", \"likelihood\": 1.0}}, {\"model\": \"campaign_trail.question\", \"pk\": 737, \"fields\": {\"priority\": 1, \"description\": \"It is basically guaranteed that there will be a coalition government after the elections. Which party would you be willing to govern with?\", \"likelihood\": 1.0}}, {\"model\": \"campaign_trail.question\", \"pk\": 738, \"fields\": {\"priority\": 1, \"description\": \"Pictures of the disastrous retreat of NATO troops from Afghanistan go around the globe. The government is sharply criticised for its botched evacuation. What do you want to emphasize in this situation?\", \"likelihood\": 1.0}}, {\"model\": \"campaign_trail.question\", \"pk\": 739, \"fields\": {\"priority\": 1, \"description\": \"September 2021: For the first time in German history, there will be a three-way debate, a so-called “Triell”. You, Scholz of the SPD and Habeck of the Green party are all invited. What do you want to focus on?\", \"likelihood\": 1.0}}, {\"model\": \"campaign_trail.question\", \"pk\": 740, \"fields\": {\"priority\": 1, \"description\": \"During the Triell, you decided to focus on Olaf Scholz, vice chancellor and candidate of the SPD. What do you want to attack him on?\", \"likelihood\": 1.0}}, {\"model\": \"campaign_trail.question\", \"pk\": 743, \"fields\": {\"priority\": 1, \"description\": \"Finally, this campaign is coming to an end. Do you have anyone, in particular, you want to campaign with during the last days before the election?\", \"likelihood\": 1.0}}]");
extraQuestions = JSON.parse("[{\"model\": \"campaign_trail.question\", \"pk\": 741, \"fields\": {\"priority\": 1, \"description\": \"During the Triell, you decided to focus on Robert Habeck, chancellor candidate of the Green party. What do you want to attack her on?\", \"likelihood\": 1.0}}, {\"model\": \"campaign_trail.question\", \"pk\": 742, \"fields\": {\"priority\": 1, \"description\": \"During the Triell, you decided to focus on presenting your case to the German people without too strong attacks. What are your main points?\", \"likelihood\": 1.0}}, {\"model\": \"campaign_trail.question\", \"pk\": 744, \"fields\": {\"priority\": 1, \"description\": \"You and Laschet both want to become the chancellor candidate for the Union of CDU/CSU. Both of you have supporters and detractors within the party. How do you want to decide this?\", \"likelihood\": 1.0}}, {\"model\": \"campaign_trail.question\", \"pk\": 745, \"fields\": {\"priority\": 1, \"description\": \"You and Laschet both want to become the chancellor candidate for the Union of CDU/CSU. Both of you have supporters and detractors within the party. How do you want to decide this?\", \"likelihood\": 1.0}}]");
campaignTrail_temp.answers_json = JSON.parse("[{\"model\": \"campaign_trail.answer\", \"pk\": 4000, \"fields\": {\"question\": 717, \"description\": \"I will offer him my congratulations. Together, we will keep writing the success story of the CDU/CSU. I’m looking forward to a close cooperation.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4001, \"fields\": {\"question\": 717, \"description\": \"Publicly, I want to congratulate him for winning this election. However, I’m worried that he will lose us the election in the fall. Behind the scenes, I will prepare my chancellor candidacy.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4002, \"fields\": {\"question\": 717, \"description\": \"Of course I will congratulate him. However, I want to make it clear that him being party leader does not automatically make him chancellor candidate. I’ll make some remarks that we will have to sort this question out later.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4003, \"fields\": {\"question\": 717, \"description\": \"First, I want to congratulate him publicly. At the same time, let’s reach out to some of the people who supported his opponents in the leadership election and start convincing them that I am the better chancellor candidate.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4004, \"fields\": {\"question\": 718, \"description\": \"I’m already well quite known among the German people, but it’s time to give my profile a boost. Let’s go to every talk show that wants to have me and make sure people see my face constantly.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4005, \"fields\": {\"question\": 718, \"description\": \"Despite my polling being better than Laschet’s, it won’t be easy to convince our parties to nominate me. I will speak with as many CDU functionaries as I can in the coming weeks to start getting them on my side.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4006, \"fields\": {\"question\": 718, \"description\": \"When the time comes, I’m sure that the party will pick me over Laschet. My focus is on the general election and I will attack the SPD and Greens whenever an opportunity presents itself.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4007, \"fields\": {\"question\": 718, \"description\": \"It would probably backfire if I personally attacked Laschet, so I will do nothing of the sort. However, I’m sure there are plenty of CSU politicians who can find things to be critical of.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4008, \"fields\": {\"question\": 719, \"description\": \"I’ve been known as a lockdown hardliner in the past. However, the situation in Bavaria is quite good compared to other states, so we can open up fairly quickly now.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4009, \"fields\": {\"question\": 719, \"description\": \"The situation is still very volatile, so I will keep doing what if been doing for the whole pandemic so far and be on the stricter side. There will be no premature openings in Bavaria.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4010, \"fields\": {\"question\": 719, \"description\": \"Throughout the pandemic, people have looked at me for leadership even outside of Bavaria and I have to keep being a leading voice in this discourse. I will call for whatever seems more popular at the moment and adjust my policy accordingly.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4011, \"fields\": {\"question\": 719, \"description\": \"Opening up is increasingly popular now, but I’m personally not convinced this isn’t premature. We can open up a few selected things but should be careful not to overdo it.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4012, \"fields\": {\"question\": 720, \"description\": \"Under no circumstances will we raise taxes, but we don’t want to dramatically lower them. We will phase out the extra tax of the Soli and try to reduce the burden on small and medium-income earners while keeping the budget balanced.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4013, \"fields\": {\"question\": 720, \"description\": \"The Covid crisis has left a massive hole in our budget that we have to plug somehow. We have to be measured, but a tax increase will likely be necessary.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4014, \"fields\": {\"question\": 720, \"description\": \"Taxes for private households should stay where they are or even be lowered by phasing out the Soli. More importantly, corporate taxes should be lowered to unleash the full economic potential of this country.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4015, \"fields\": {\"question\": 720, \"description\": \"The most important thing we can do now is lower the taxes for small and medium income earners, our tax policy is failing them. Besides that, I’ll mainly attack the tax plans of the other parties.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4016, \"fields\": {\"question\": 721, \"description\": \"I’m as shocked and outraged as everyone else when this came to light. There will be new rules for members of my party that they have to make all earnings public, to prevent something like this from happening again.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4017, \"fields\": {\"question\": 721, \"description\": \"Let’s wait and see how this develops. I’ll issue a brief statement that we want to wait until it’s clear what actually happened. Luckily, it seems like the CDU is in more trouble than the CSU, so maybe I can use this to paint me as a more competent party leader.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4018, \"fields\": {\"question\": 721, \"description\": \"This is nothing but a political hit job by a left-wing magazine in an election year. I’m sure further investigations will prove the innocence of these MPs.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4019, \"fields\": {\"question\": 721, \"description\": \"We have to deflect from this as much as possible. I will make it clear that I have zero tolerance for corruption but don’t want this to become a big topic.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4020, \"fields\": {\"question\": 722, \"description\": \"I have to be careful here, I don’t want to come across as power-hungry. I will tell Laschet that I think a challenge would be best for the party.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4021, \"fields\": {\"question\": 722, \"description\": \"He probably doesn’t expect this challenge from me, so let’s make an announcement as soon as possible to catch him by surprise.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4022, \"fields\": {\"question\": 722, \"description\": \"Doing this the wrong way could backfire. I’ll have my supporters in the CDU and CSU demand that I save the party from bad polling numbers, and then - reluctantly - declare my candidacy.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4023, \"fields\": {\"question\": 723, \"description\": \"I’m sure Laschet will try to force a vote by the party elites. I’ll let him, he’ll be surprised by how much support I have even among them.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4024, \"fields\": {\"question\": 723, \"description\": \"During the next few days, I will hammer my main argument again and again - I have the better polling numbers, and I’m the one who can lead the CDU/CSU to victory in the fall. Laschet would lose and the rest of the party have to accept this.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4025, \"fields\": {\"question\": 723, \"description\": \"The party parliamentary group of CDU and CSU shall vote on this. I’m confident they will pick me over Laschet. They have to see I’m the stronger candidate!\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4026, \"fields\": {\"question\": 723, \"description\": \"The party parliamentary group of CDU and CSU shall vote on this. I’m confident they will pick me over Laschet. They have to see I’m the stronger candidate!\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4027, \"fields\": {\"question\": 724, \"description\": \"First and foremost, I want to thank Armin Laschet for this fair competition. We have to be united as a party to win this fall. Apart from that, I will hit my usual talking points.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4028, \"fields\": {\"question\": 724, \"description\": \"If you want to look at how I want to govern this country, look at Bavaria. We are one of the most successful states by a number of metrics and my popularity there speaks for itself.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4029, \"fields\": {\"question\": 724, \"description\": \"It’s clear that the two most important topics this election are Covid and climate change. I will guide Germany through the pandemic like I guided Bavaria, and I will make sure our transition to renewable energies goes smoothly\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4030, \"fields\": {\"question\": 724, \"description\": \"There are some things I didn’t agree with during Merkel’s chancellorship - especially her migration policy. However, overall I want to follow in her path and continue her successful leadership.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4031, \"fields\": {\"question\": 725, \"description\": \"The Green party is always surging a few months before elections and comes crashing down in time. I’m not too worried and will still focus more on competing with the SPD.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4032, \"fields\": {\"question\": 725, \"description\": \"I will take this development very seriously. Let’s simultaneously say that we need to take climate change seriously and attack the Greens for some of their more extreme proposals.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4033, \"fields\": {\"question\": 725, \"description\": \"Off the record, it’s not the worst thing that these two parties compete for centre-left votes. This makes the path for us to come first a lot easier. Let’s try to focus a bit more on the Green Party now that they are in the lead.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4034, \"fields\": {\"question\": 725, \"description\": \"Actually, this is a bit ridiculous and reminds me of the publicity stunt the FDP pulled in 2002 when they nominated a chancellor candidate. Let’s mock them for their hubris and don’t refer to Habeck as a chancellor candidate.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4035, \"fields\": {\"question\": 726, \"description\": \"It is important that we don’t demonise Putin and keep our dialogue open. We have important business interests that shouldn’t be endangered like North Stream 2. However,  I’m critical of some things the Russian leadership has done\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4036, \"fields\": {\"question\": 726, \"description\": \"I’ve been more lenient in the past, but enough is enough. I will join in with the criticism against Kretschmer and call for a tougher stance towards Russia. Maybe we should only open the North Stream 2 pipeline if we get some concessions from Russia.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4037, \"fields\": {\"question\": 726, \"description\": \"Kretschmer is completely right, we have to talk more with Russia, not less. I’m all in favour of more dialogue and stronger economic ties with Russia. Putin is reasonable and can be talked to, as I did last year!\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4038, \"fields\": {\"question\": 726, \"description\": \"This whole thing is overblown, the trip was mostly for cultural exchange, as was my own last year. I don’t have much to say about this.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4039, \"fields\": {\"question\": 727, \"description\": \"This was a bad decision by the court. The Climate Protection Act already went far enough and I’m not in favour of hurting the economy with a strict climate policy.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4040, \"fields\": {\"question\": 727, \"description\": \"I’ve always been an advocate for doing more against climate change. While this has not been mandated by the court, we will also rework our regional Climate Protection Act in Bavaria, to make sure we are doing enough.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4041, \"fields\": {\"question\": 727, \"description\": \"We have to become carbon neutral long before 2050. I’m sure the government will come up with a sensible solution, which I will continue as chancellor.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4042, \"fields\": {\"question\": 727, \"description\": \"With the decision by the court, we now have the great opportunity to have an ambitious new Climate Protection Act. Bavaria is on its way to becoming carbon-neutral by 2040, and the whole country should be put on a similar path.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4043, \"fields\": {\"question\": 728, \"description\": \"We need to open up quickly for vaccinated people. A return to normalcy has never been so close, and we all had more than enough of lockdowns.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4044, \"fields\": {\"question\": 728, \"description\": \"We have to be careful now - on the one hand, we should open up for vaccinated people, but we have to make sure social cohesion is not endangered by giving vaccinated people too many privileges.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4045, \"fields\": {\"question\": 728, \"description\": \"It’s important that as many people as possible get vaccinated as quickly as possible so we can overcome this crisis. We have to think of measures to get more people vaccinated, like organizing vaccination events in supermarkets\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4046, \"fields\": {\"question\": 728, \"description\": \"The vaccine seems helpful now, but we haven’t had a chance to study its side effects yet. I advocate for a slowdown of the vaccination campaign until we have more information.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4047, \"fields\": {\"question\": 729, \"description\": \"For years and years, we have consistently missed the NATO aim to spend 2% of our gross domestic product on defence. I reaffirm our commitment to NATO and this goal!\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4048, \"fields\": {\"question\": 729, \"description\": \"I specifically want to call out Robert Habeck. He’s lacking a clear commitment to NATO, which is not appropriate for a chancellor.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4049, \"fields\": {\"question\": 729, \"description\": \"Our defence policy is adequate as it is right now. While I want to strongly reaffirm my commitment to NATO, we don’t need to spend more on defence than we do right now.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4050, \"fields\": {\"question\": 729, \"description\": \"NATO is a relict of the cold war. We should stay a member of this alliance for now, but we should also try to find avenues for cooperating with other states like Russia.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4051, \"fields\": {\"question\": 730, \"description\": \"I want to congratulate Haseloff for his strong performance. It shows that the citizens still trust the CDU to be the best governing party.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4052, \"fields\": {\"question\": 730, \"description\": \"Haseloff performed very well, but I also want to emphasize that the AfD lost votes. When we keep appealing to all people, we can win them back to our more democratic parties.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4053, \"fields\": {\"question\": 730, \"description\": \"This was a very strong performance. We should campaign together for the upcoming general elections.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4054, \"fields\": {\"question\": 731, \"description\": \"The pandemic and subsequent lockdowns have shown how ill-prepared our schools are. I want to put the focus primarily on improving the digital infrastructure of schools.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4055, \"fields\": {\"question\": 731, \"description\": \"Actually, we don’t have much to gain by talking about this topic. Let’s downplay it as much as we can and focus on other things.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4056, \"fields\": {\"question\": 731, \"description\": \"We want to modernize the digital infrastructure of Germany, be it in schools, in public administration or in the government itself.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4057, \"fields\": {\"question\": 731, \"description\": \"Digitalization is an important topic for us, and I want to especially emphasize that we need to finish the nationwide 5G mobile network by 2025.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4058, \"fields\": {\"question\": 732, \"description\": \"This was a tragic day, we mourn for all the victims. The most important thing we can do right now is help the affected regions with their crisis management.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4059, \"fields\": {\"question\": 732, \"description\": \"This has been an incredible wake-up call of nature. We have to evaluate what we can do to prepare for events like this in the future. For now, helping the victims has the highest priority.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4060, \"fields\": {\"question\": 732, \"description\": \"First, we need to help the affected regions with the cleanup. After that, we have to guarantee financial emergency aid for affected people.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4061, \"fields\": {\"question\": 732, \"description\": \"Extreme weather events are unfortunately going to become more common due to climate change. We have to do a lot more than we are doing now. This might be expensive, but the costs of doing nothing are much, much higher.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4062, \"fields\": {\"question\": 733, \"description\": \"Actually, I don’t want to be seen as performative. I will keep coordinating the crisis efforts from the state chancellery.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4063, \"fields\": {\"question\": 733, \"description\": \"Of course I want to go out there! I will travel to affected areas in Bavaria and show myself as a man of action, with rubber boots an all.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4064, \"fields\": {\"question\": 733, \"description\": \"Of course I want to go out there! I will travel to affected areas all over Germany in the coming days, to show that I don’t just care about my home state.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4065, \"fields\": {\"question\": 733, \"description\": \"Of course I want to go out there! I will travel to affected areas in Bavaria and especially focus on talking to as many affected people as possible.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4066, \"fields\": {\"question\": 734, \"description\": \"The floodings have shown that we need to be much more ambitious than before! For example, we need to stop using coal for energy generation by 2030.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4067, \"fields\": {\"question\": 734, \"description\": \"Climate change is coming, whether we want it or not. The most important thing we can do is mitigate its worst effects to prevent catastrophes like this from doing too much damage.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4068, \"fields\": {\"question\": 734, \"description\": \"Let’s wait until Habeck makes a statement, then co-opt the more popular parts of what he said while calling for moderation.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4069, \"fields\": {\"question\": 734, \"description\": \"We need to do more to reduce our carbon emissions. Maybe we have to rethink the decision to exit nuclear energy before coal after recent events.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4070, \"fields\": {\"question\": 735, \"description\": \"We don’t need mandatory vaccines for everyone, but it should be mandatory for some jobs, like hospital personnel.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4071, \"fields\": {\"question\": 735, \"description\": \"While I wouldn’t go that far, we can give people more incentives to get vaccinated, like opening up things only for vaccinated and recovered people.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4072, \"fields\": {\"question\": 735, \"description\": \"Covid is basically over, the case numbers are very low. I question if we need this expensive vaccination campaign at all.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4073, \"fields\": {\"question\": 735, \"description\": \"I also think this is a good idea. We need to do everything we can to finally make Covid history.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4074, \"fields\": {\"question\": 736, \"description\": \"The highway toll seemed like a good idea at the time, but clearly, we were wrong. I apologize that we couldn’t keep this promise.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4075, \"fields\": {\"question\": 736, \"description\": \"Actually, the project only failed because the EU sabotaged it. Once again, this has shown how unaccountable Brussels is, we need to carefully reevaluate our relationship with the EU.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4076, \"fields\": {\"question\": 736, \"description\": \"Scheuer really screwed this up. I’ll publically criticize him for his incompetence and make it clear there will be no political post for him in my government.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4077, \"fields\": {\"question\": 736, \"description\": \"It’s true that we didn’t manage to get the highway toll through during the last four years - but with me as chancellor, I promise that we will get it done in the next four years!\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4078, \"fields\": {\"question\": 737, \"description\": \"We will talk with all democratic parties - the SPD, the Greens and the FDP. Unfortunately, not all parties will rule out coalition talks with the extremist Left party.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4079, \"fields\": {\"question\": 737, \"description\": \"The grand coalition of the last 8 years is increasingly unpopular. We need to find a different governing majority. I’d prefer a Black-Green or Jamaica Coalition with the Greens and FDP.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4080, \"fields\": {\"question\": 737, \"description\": \"Actually, this new party spectrum needs new solutions. I think a Bahamas coalition with the AfD and the FDP could work.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4081, \"fields\": {\"question\": 737, \"description\": \"Jamaica, Bahamas… All these coalition names make me want to take a holiday in the Carribean.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4082, \"fields\": {\"question\": 738, \"description\": \"This is a debacle for both the West and us specifically. We now have to analyse what went wrong and how we can avoid such situations in the future.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4083, \"fields\": {\"question\": 738, \"description\": \"We need to take in more refugees from Afghanistan, especially people who cooperated with the German troops. We owe it to these people after they helped us!\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4084, \"fields\": {\"question\": 738, \"description\": \"The foreign ministry under SPD control is clearly to blame for our part in this crisis, and Foreign Minister Maas should resign. His behaviour is just embarrassing.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4085, \"fields\": {\"question\": 738, \"description\": \"We can’t have a repeat of the refugee crisis of 2015. We need to take it some refugees, yes, but avoid pictures like that at all costs.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4086, \"fields\": {\"question\": 739, \"description\": \"Scholz has been struggling in the polls, but the SPD is still our main opponent. I will focus on him.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4087, \"fields\": {\"question\": 739, \"description\": \"Habeck of course - he seems to be my main opponent right now.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4088, \"fields\": {\"question\": 739, \"description\": \"I will leave petty attacks to my opponents and focus more on policy. I’m certain the German people will appreciate hearing concrete solutions to their problems more than attacks.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4089, \"fields\": {\"question\": 739, \"description\": \"Actually, I don’t want two left-wing politicians to gang up on me. Let the two of them duke it out, I won’t attend this so-called Triell.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4090, \"fields\": {\"question\": 740, \"description\": \"He likes to present himself as a moderate, but he hasn’t completely ruled out a coalition with the extremist Left party. Can voters really trust him not to form this coalition after the election?\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4091, \"fields\": {\"question\": 740, \"description\": \"Let’s hit him on his scandals as finance minister. Under his watch, Wirecard collapsed due to fraudulent dealings and lots of people lost their money. There was even a police raid on a government office belonging to his ministry.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4092, \"fields\": {\"question\": 740, \"description\": \"The program of his party is very leftwing, especially regarding pensions and the minimum wage. It shows that the SPD as a whole is unfit to govern.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4093, \"fields\": {\"question\": 740, \"description\": \"Actually, I’ve changed my mind. I’m just going to present myself as calm and above petty attacks.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4094, \"fields\": {\"question\": 741, \"description\": \"He’s made some bizarre statements on Twitter in the past, including calling Bavaria a “one-party-state” because the CSU is so successful there. I’ll attack him on that.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4095, \"fields\": {\"question\": 741, \"description\": \"Everyone on this stage agrees that something has to be done about climate change, but trying to forbid everything as Mr Habeck and his party want can’t be the solution!\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4096, \"fields\": {\"question\": 741, \"description\": \"I’ll attack him for his willingness to govern with the radical Left party. This coalition is unpopular, moderates should be frightened by this prospect.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4097, \"fields\": {\"question\": 741, \"description\": \"Actually, I’ve changed my mind. I’m just going to present myself as calm and above petty attacks.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4098, \"fields\": {\"question\": 742, \"description\": \"I want to present myself as the candidate having the best market-focused and realistic solutions for climate change. We are on a good path and don’t need more government intervention and bans on things.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4099, \"fields\": {\"question\": 742, \"description\": \"With two left-leaning politicians debating with me, I will present myself as the voice of reason. For example, I have tax and social security plans that are actually affordable and generally promise sensible governance.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4100, \"fields\": {\"question\": 742, \"description\": \"I’ve governed Bavaria successfully and am ready to bring this success to the federal level. My administration will both be a continuity of the Merkel years and a new start.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4101, \"fields\": {\"question\": 742, \"description\": \"Actually, screw this! I will attack them both whenever an opportunity presents itself. That way, I can sharpen my profile and show myself as the most competent candidate.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4102, \"fields\": {\"question\": 743, \"description\": \"It’s important that all wings of our party stay united and motivated to vote. Let’s campaign with Friedrich Merz to show that I’m taking people like him and his positions seriously.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4103, \"fields\": {\"question\": 743, \"description\": \"Who else but Angela Merkel could be the right person? She has won the last four elections, and I want to show people that I’m the one to continue her legacy.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4104, \"fields\": {\"question\": 743, \"description\": \"I’m worried about the AfD taking first place in some East German states. I want to campaign there with local CDU politicians like Haselhof and Kretschmer.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4105, \"fields\": {\"question\": 743, \"description\": \"Armin Laschet, my rival from back in the spring, could help me mobilize voters in North Rhine-Westphalia. That’s the largest state and one I want to win!\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4106, \"fields\": {\"question\": 744, \"description\": \"I’m sure Laschet will try to force a vote by the party elites. I’ll let him, he’ll be surprised by how much support I have even among them.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4107, \"fields\": {\"question\": 744, \"description\": \"During the next few days, I will hammer my main argument again and again - I have the better polling numbers, and I’m the one who can lead the CDU/CSU to victory in the fall. Laschet and the rest of the party have to accept this.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4108, \"fields\": {\"question\": 744, \"description\": \"The party parliamentary group of CDU and CSU shall vote on this. I’m confident they will pick me over Laschet. They have to see I’m the stronger candidate!\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4109, \"fields\": {\"question\": 744, \"description\": \"The party parliamentary group of CDU and CSU shall vote on this. I’m confident they will pick me over Laschet. They have to see I’m the stronger candidate!\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4110, \"fields\": {\"question\": 745, \"description\": \"I’m sure Laschet will try to force a vote by the party elites. I’ll let him, he’ll be surprised by how much support I have even among them.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4111, \"fields\": {\"question\": 745, \"description\": \"During the next few days, I will hammer my main argument again and again - I have the better polling numbers, and I’m the one who can lead the CDU/CSU to victory in the fall. Laschet and the rest of the party have to accept this.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4112, \"fields\": {\"question\": 745, \"description\": \"The party parliamentary group of CDU and CSU shall vote on this. I’m confident they will pick me over Laschet. They have to see I’m the stronger candidate!\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4113, \"fields\": {\"question\": 745, \"description\": \"The party parliamentary group of CDU and CSU shall vote on this. I’m confident they will pick me over Laschet. They have to see I’m the stronger candidate!\"}}]");
