campaignTrail_temp.answer_feedback_json = JSON.parse("[{\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5000, \"fields\": {\"answer\": 4000, \"candidate\": 77, \"answer_feedback\": \"That’s what people expected, though some notice your silence regarding the question who of you will be chancellor candidate.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5001, \"fields\": {\"answer\": 4001, \"candidate\": 77, \"answer_feedback\": \"It seems wise to bide your time here and not immediately challenge him. Hopefully, you’ll be able to clinch the chancellor candidacy when the time is right.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5002, \"fields\": {\"answer\": 4002, \"candidate\": 77, \"answer_feedback\": \"Many in the CDU see this as the wrong moment to attack him, so close after the party picked him. This will cost you some popularity.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5003, \"fields\": {\"answer\": 4003, \"candidate\": 77, \"answer_feedback\": \"You’re lucky none of this is leaked and since not everyone is receptive, though this might make it easier for you to become chancellor candidate later on.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5004, \"fields\": {\"answer\": 4004, \"candidate\": 77, \"answer_feedback\": \"With this strategy, both your name recognition and favourability numbers go up a bit.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5005, \"fields\": {\"answer\": 4005, \"candidate\": 77, \"answer_feedback\": \"While this should help you win the nomination later on, it also alerts Laschet and his allies that you’re probably up to something.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5006, \"fields\": {\"answer\": 4006, \"candidate\": 77, \"answer_feedback\": \"People notice that you’re already in full campaign mode. Quite a few times in the next few weeks, you get in some good attacks on those two parties.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5007, \"fields\": {\"answer\": 4007, \"candidate\": 77, \"answer_feedback\": \"Over the coming weeks, Laschet has to defend himself again and again. There’s talk in the press about the disunity between the CDU and CSU, but his favourability numbers get dragged down more than yours.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5008, \"fields\": {\"answer\": 4008, \"candidate\": 77, \"answer_feedback\": \"At first, this looked like a good strategy. However, cases started surging again and you had to change back to being stricter. The whole episode has made you seem indecisive.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5009, \"fields\": {\"answer\": 4009, \"candidate\": 77, \"answer_feedback\": \"At first, people are grumbling, but when cases start to surge again, this looks like a good call. Lockdowns are unpopular in East Germany, though, and some Bavarians don’t like that their state is much stricter than others.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5010, \"fields\": {\"answer\": 4010, \"candidate\": 77, \"answer_feedback\": \"You are known for being opportunistic, but you are also very good at it. This mostly works, and more and more people in Germany wish they had you in charge of things.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5011, \"fields\": {\"answer\": 4011, \"candidate\": 77, \"answer_feedback\": \"People are not quite sure what to make of this middle-of-the-road strategy. It’s not unpopular, but it’s not exactly convincing anyone either.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5012, \"fields\": {\"answer\": 4012, \"candidate\": 77, \"answer_feedback\": \"This is a bit more cautious than your expected position. While it is by no means unpopular, it isn’t particularly visionary either.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5013, \"fields\": {\"answer\": 4013, \"candidate\": 77, \"answer_feedback\": \"Disappointed voters turn towards the FDP and even AfD. While tax increases are somewhat popular among left-wing voters, your base is not pleased at all, especially since this is not consistent with what you are known for.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5014, \"fields\": {\"answer\": 4014, \"candidate\": 77, \"answer_feedback\": \"This is a bit more market-liberal than people have expected from you, but it is in line with your party and helps keep voters voting for you instead of the FDP.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5015, \"fields\": {\"answer\": 4015, \"candidate\": 77, \"answer_feedback\": \"A bit of a populist tone, but that is on-brand for you. A lot of people really like this position, though some more left-wing people are concerned about what you would cut to finance this.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5016, \"fields\": {\"answer\": 4016, \"candidate\": 77, \"answer_feedback\": \"While the CDU/CSU as a whole is hurt by this scandal, you at least try to mitigate its worst effects.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5017, \"fields\": {\"answer\": 4017, \"candidate\": 77, \"answer_feedback\": \"As more details come out, the CSU ends up looking especially corrupt. This damages both your personally and the party as a whole.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5018, \"fields\": {\"answer\": 4018, \"candidate\": 77, \"answer_feedback\": \"Despite your fiery rebuke, nobody is buying this, as the report is well sourced and new details come out almost every day. This makes you seem very out of touch with the public mood.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5019, \"fields\": {\"answer\": 4019, \"candidate\": 77, \"answer_feedback\": \"At first, this sort of works, but the scandal becomes too big to downplay. At least, your personal numbers don’t get damaged too much.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5020, \"fields\": {\"answer\": 4020, \"candidate\": 77, \"answer_feedback\": \"Obviously, he is not thrilled, and while the CSU supports you, the CDU is split over this. You will have to duke it out in the coming weeks.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5021, \"fields\": {\"answer\": 4021, \"candidate\": 77, \"answer_feedback\": \"Only a day later, he declares his candidacy as well. While this might have gotten you a small advantage for moving first, it also makes you seem power-hungry.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5022, \"fields\": {\"answer\": 4022, \"candidate\": 77, \"answer_feedback\": \"Not everyone is buying this, but framing the whole thing around only wanting what’s best for the party helps you.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5023, \"fields\": {\"answer\": 4023, \"candidate\": 77, \"answer_feedback\": \"Unfortunately, this didn’t work out and Laschet becomes the chancellor candidate. Maybe you should have done more to convince people within the party…\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5024, \"fields\": {\"answer\": 4024, \"candidate\": 77, \"answer_feedback\": \"Eventually, after days of pressure, Laschet withdraws his candidacy. However, there are a lot of bitter feelings about your accusations, and many in the CDU are very unenthusiastic about supporting you.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5025, \"fields\": {\"answer\": 4025, \"candidate\": 77, \"answer_feedback\": \"A lot of them buy this argument, but sadly, not enough are convinced. Laschet narrowly wins the vote and you have to watch from Bavaria as he tries to become chancellor.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5026, \"fields\": {\"answer\": 4026, \"candidate\": 77, \"answer_feedback\": \"While the vote is close, in the end, you come out victorious. Laschet accepts the vote and both of you can move on to focus on the upcoming campaign. This still ordeal still damaged your image, though.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5027, \"fields\": {\"answer\": 4027, \"candidate\": 77, \"answer_feedback\": \"Party unity is always a good thing, and both the CDU as a whole and the important state party in North Rhine-Westphalia like hearing this, even though Laschet himself is still sulking.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5028, \"fields\": {\"answer\": 4028, \"candidate\": 77, \"answer_feedback\": \"Bavarians like this speech a lot, but people in Germany in general are often critical of the CSU. Hopefully, you can overcome this during your campaign.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5029, \"fields\": {\"answer\": 4029, \"candidate\": 77, \"answer_feedback\": \"You have a good feeling about what voters care about and how to talk to them. The speech is well received.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5030, \"fields\": {\"answer\": 4030, \"candidate\": 77, \"answer_feedback\": \"After 16 years, people are clamouring for a stronger change, and your focus on migration policy in an election where that was no big topic so far is a bit odd.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5031, \"fields\": {\"answer\": 4031, \"candidate\": 77, \"answer_feedback\": \"Maybe you’re onto something, though ignoring Habeck seems foolish in the current situation.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5032, \"fields\": {\"answer\": 4032, \"candidate\": 77, \"answer_feedback\": \"There are many voters who want climate change to be taken seriously, but are turned off by some Green party proposals. This is an effective strategy to win them over.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5033, \"fields\": {\"answer\": 4033, \"candidate\": 77, \"answer_feedback\": \"You’re probably right, but your party has lost some voters to the Greens too. You shouldn’t become too comfortable.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5034, \"fields\": {\"answer\": 4034, \"candidate\": 77, \"answer_feedback\": \"This seems very petty and even desperate considering the current polling. Also, you might need the Green party as a coalition partner and making fun of them like this will make the negotiations harder.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5035, \"fields\": {\"answer\": 4035, \"candidate\": 77, \"answer_feedback\": \"You are disparagingly called “Putin understander” by some, though especially in East Germany this position is quite popular, and many companies are relieved.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5036, \"fields\": {\"answer\": 4036, \"candidate\": 77, \"answer_feedback\": \"Considering your own trip to Moscow last year, this is seen as too opportunistic even for you. Some people like a tougher stance on Russia, though.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5037, \"fields\": {\"answer\": 4037, \"candidate\": 77, \"answer_feedback\": \"For the majority of people, this position is viewed as being too lenient towards Russia. The pictures of you next to Putin make you look statemenslike to some but are criticized by others.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5038, \"fields\": {\"answer\": 4038, \"candidate\": 77, \"answer_feedback\": \"Calling your own trip just for culture exchange is a blatant lie, for which you get called out.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5039, \"fields\": {\"answer\": 4039, \"candidate\": 77, \"answer_feedback\": \"The mood in this country is not receptive to statements like this. You get harsh criticism from the Greens and even some in your own party.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5040, \"fields\": {\"answer\": 4040, \"candidate\": 77, \"answer_feedback\": \"You manage to somewhat blunt the advantage the Green party has with this topic, though at the cost of upsetting some conservatives.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5041, \"fields\": {\"answer\": 4041, \"candidate\": 77, \"answer_feedback\": \"A fairly vague answer, which offends no one but also doesn’t appeal to anyone.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5042, \"fields\": {\"answer\": 4042, \"candidate\": 77, \"answer_feedback\": \"For many in your own party, this goes too far, though you appeal to Green Party voters this way.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5043, \"fields\": {\"answer\": 4043, \"candidate\": 77, \"answer_feedback\": \"While this stance is appreciated by some people, the majority of people who haven’t had a chance to get vaccinated yet are not thrilled.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5044, \"fields\": {\"answer\": 4044, \"candidate\": 77, \"answer_feedback\": \"This is a bit more on the cautious side, but overall, quite well received by all corners of society.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5045, \"fields\": {\"answer\": 4045, \"candidate\": 77, \"answer_feedback\": \"With the limited supply of vaccines available, there are not enough doses to vaccinate everyone who wants it right now, and health experts say there is no reason to start vaccinating people in supermarkets\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5046, \"fields\": {\"answer\": 4046, \"candidate\": 77, \"answer_feedback\": \"This position places you far outside the mainstream. A certain part of the population - include your own Vice Minister-President - call you their hero, but prepare for a drop in the polls.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5047, \"fields\": {\"answer\": 4047, \"candidate\": 77, \"answer_feedback\": \"The audience cheers you on, as spending more on defence is always popular in more conservative circles. Not every potential voter is convinced of this, though.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5048, \"fields\": {\"answer\": 4048, \"candidate\": 77, \"answer_feedback\": \"With how strong the Green Party has been in the polls lately, hitting on them seems like a good strategy. However, Habeck hasn’t really made statements like this, so the attack is ineffective\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5049, \"fields\": {\"answer\": 4049, \"candidate\": 77, \"answer_feedback\": \"This does little to differentiate you from other parties and is softer on defence than the usual position of your party.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5050, \"fields\": {\"answer\": 4050, \"candidate\": 77, \"answer_feedback\": \"Maybe a few AfD voters will like this statement. Everyone else is horrified, especially your party colleagues.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5051, \"fields\": {\"answer\": 4051, \"candidate\": 77, \"answer_feedback\": \"While his performance was impressive, it might have to do something with incumbency. Still, it’s not a bad sign.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5052, \"fields\": {\"answer\": 4052, \"candidate\": 77, \"answer_feedback\": \"Winning back AfD voters is something the CDU has tried for years. Hopefully, you can succeed with it this fall.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5053, \"fields\": {\"answer\": 4053, \"candidate\": 77, \"answer_feedback\": \"Haseloff is glad to campaign with you. This will help you in Saxony-Anhalt and maybe in neighbouring regions.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5054, \"fields\": {\"answer\": 4054, \"candidate\": 77, \"answer_feedback\": \"You’re right that this is an important topic, but many blame your party for the current misery. Maybe it’s best not to focus on it so strongly.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5055, \"fields\": {\"answer\": 4055, \"candidate\": 77, \"answer_feedback\": \"It’s not the most important topic this election, but especially young voters are disappointed by your lack of a proper position.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5056, \"fields\": {\"answer\": 4056, \"candidate\": 77, \"answer_feedback\": \"Most parties are calling for something like this, and you don’t differentiate yourself from them.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5057, \"fields\": {\"answer\": 4057, \"candidate\": 77, \"answer_feedback\": \"This is a strong promise that will especially help you in less urban areas.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5058, \"fields\": {\"answer\": 4058, \"candidate\": 77, \"answer_feedback\": \"This response will help you in those areas, though some say that this is the least you can do.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5059, \"fields\": {\"answer\": 4059, \"candidate\": 77, \"answer_feedback\": \"A balanced approach like this is appreciated by most voters. You also assure voters concerned about climate change without drawing the issue into the discussion too much.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5060, \"fields\": {\"answer\": 4060, \"candidate\": 77, \"answer_feedback\": \"Your own state government restricted emergency aid in such situations two years ago. This makes you seem opportunistic.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5061, \"fields\": {\"answer\": 4061, \"candidate\": 77, \"answer_feedback\": \"It’s good to not let the Green Party be the only ones who connect this to climate change, but turning this into a climate issue still helps the Greens more than you.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5062, \"fields\": {\"answer\": 4062, \"candidate\": 77, \"answer_feedback\": \"You are accused of being missing in action, but this might be safer.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5063, \"fields\": {\"answer\": 4063, \"candidate\": 77, \"answer_feedback\": \"Being seen helps you both in Bavaria, and voters like the pictures of you in action.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5064, \"fields\": {\"answer\": 4064, \"candidate\": 77, \"answer_feedback\": \"While the sentiment is appreciated, a picture of Laschet laughing during one of your visits soon dominates the news coverage and hurts the perception of your party. At least you’re not in the picture.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5065, \"fields\": {\"answer\": 4065, \"candidate\": 77, \"answer_feedback\": \"There are some tense moments and you have some awkward conversations, but overall, the visit goes well and people appreciate being heard.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5066, \"fields\": {\"answer\": 4066, \"candidate\": 77, \"answer_feedback\": \"This is a very strong statement, and coal-producing regions are unhappy with this pivot. Still, this could win over some green voters.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5067, \"fields\": {\"answer\": 4067, \"candidate\": 77, \"answer_feedback\": \"People expected a little more from you since you’ve been a strong proponent of doing more against climate change in the past.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5068, \"fields\": {\"answer\": 4068, \"candidate\": 77, \"answer_feedback\": \"There are people who notice the timing of your statement, but overall, voters see you as the voice of reason in this discourse.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5069, \"fields\": {\"answer\": 4069, \"candidate\": 77, \"answer_feedback\": \"This is a controversial topic with people on both sides of the argument. It doesn’t help that the decision to stop relying on nuclear energy was originally made by Merkel and supported by the CSU and you in particular.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5070, \"fields\": {\"answer\": 4070, \"candidate\": 77, \"answer_feedback\": \"There are people for whom even that goes too far, but this position is broadly popular.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5071, \"fields\": {\"answer\": 4071, \"candidate\": 77, \"answer_feedback\": \"This statement is received quite well overall and might make vaccinations more attractive. You might lose voters sceptical about vaccinations though.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5072, \"fields\": {\"answer\": 4072, \"candidate\": 77, \"answer_feedback\": \"You win over some anti-Covid Querdenker. The rest of the country is deeply confused by this statement.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5073, \"fields\": {\"answer\": 4073, \"candidate\": 77, \"answer_feedback\": \"You’ve positioned yourself at the fringe of the conversation, compulsory vaccinations are generally unpopular.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5074, \"fields\": {\"answer\": 4074, \"candidate\": 77, \"answer_feedback\": \"For a lot of people, this doesn’t go enough, considering how much money was wasted.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5075, \"fields\": {\"answer\": 4075, \"candidate\": 77, \"answer_feedback\": \"Eurosceptisism doesn’t play as well in Germany right now, and this seems like an attempt to shift the blame.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5076, \"fields\": {\"answer\": 4076, \"candidate\": 77, \"answer_feedback\": \"With how unpopular Scheuer is, throwing him under the bus helps you more than it hurts you. This still doesn’t reflect greatly on the CSU as a whole, though.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5077, \"fields\": {\"answer\": 4077, \"candidate\": 77, \"answer_feedback\": \"Four years later, the idea seems unworkable and barely anyone supports it anymore. This promise isn’t what people wanted to hear.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5078, \"fields\": {\"answer\": 4078, \"candidate\": 77, \"answer_feedback\": \"This is your expected answer, but needling Scholz and Habeck on their unclear statements towards the Left party plays well with your base.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5079, \"fields\": {\"answer\": 4079, \"candidate\": 77, \"answer_feedback\": \"The grand coalition is unpopular and might not even get a majority, while many people would like Black-Green or Jamaica, so this is a popular position.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5080, \"fields\": {\"answer\": 4080, \"candidate\": 77, \"answer_feedback\": \"This goes against everything you and other CDU politicians have been saying. A coalition containing the AfD is poison to moderate voters, and both the SPD and the Green party rule out a coalition with you in turn. It’s unclear if the AfD wants to work with you, too.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5081, \"fields\": {\"answer\": 4081, \"candidate\": 77, \"answer_feedback\": \"Focus! This is not the 2025NL mod, there is no funny ending where you go to the Carribean here!\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5082, \"fields\": {\"answer\": 4082, \"candidate\": 77, \"answer_feedback\": \"Many see your analysis as correct, but wanted to hear more about what you wanted to do now.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5083, \"fields\": {\"answer\": 4083, \"candidate\": 77, \"answer_feedback\": \"It’s unclear how you want to actually evacuate them and since you’ve been critical of refugees in the past, people doubt your sincerity. A position like this might also help the AfD.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5084, \"fields\": {\"answer\": 4084, \"candidate\": 77, \"answer_feedback\": \"The SPD retorts by blaming the CDU-led defence ministry. This mudslinging is unproductive, but you’re good at attacking, so this hurts the SPD more than you.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5085, \"fields\": {\"answer\": 4085, \"candidate\": 77, \"answer_feedback\": \"This keeps the AfD at bay, but is sharply criticized by more left-wing parties. This is in line with the views you expressed in prior years too, so people believe you when you say this.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5086, \"fields\": {\"answer\": 4086, \"candidate\": 77, \"answer_feedback\": \"Perhaps his position is stronger than the polls suggest - let’s see how this plays out.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5087, \"fields\": {\"answer\": 4087, \"candidate\": 77, \"answer_feedback\": \"The Green Party is in a stronger position than most people had expected, so this makes sense.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5088, \"fields\": {\"answer\": 4088, \"candidate\": 77, \"answer_feedback\": \"Let’s hope taking the high road helps you stand out!\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5089, \"fields\": {\"answer\": 4089, \"candidate\": 77, \"answer_feedback\": \"Many question your judgment. This makes it look to people like the race is between Habeck and Scholz.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5090, \"fields\": {\"answer\": 4090, \"candidate\": 77, \"answer_feedback\": \"Scholz is in a bit of an awkward spot with this attack and doesn’t give a clear answer. Overall, you and Habeck tie the debate.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5091, \"fields\": {\"answer\": 4091, \"candidate\": 77, \"answer_feedback\": \"A damaging attack, but he and Habeck hit back by mentioning corruption in your party -  the CSU is probably the party with the most shady dealings. This hurts you quite a bit and Habeck wins the debate.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5092, \"fields\": {\"answer\": 4092, \"candidate\": 77, \"answer_feedback\": \"You might have had an opening there, but the second part is an odd avenue of attack considering the CDU had a coalition government with the SPD for the past eight years. Scholz rebukes this rather easily and is seen as the winner of the debate.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5093, \"fields\": {\"answer\": 4093, \"candidate\": 77, \"answer_feedback\": \"Since you haven’t prepared for this strategy, this doesn’t help you. Scholz is seen as the winner of the debate.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5094, \"fields\": {\"answer\": 4094, \"candidate\": 77, \"answer_feedback\": \"To most people, this seems like a non-issue and a petty attack. Overall, Habeck and Scholz tie the debate.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5095, \"fields\": {\"answer\": 4095, \"candidate\": 77, \"answer_feedback\": \"This devolves into a heated back and forth between the two, though you come out on top and win the debate overall.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5096, \"fields\": {\"answer\": 4096, \"candidate\": 77, \"answer_feedback\": \"Many Green voters aren’t against this potential coalition, though some moderates are concerned. Overall, Scholz and you tie the debate.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5097, \"fields\": {\"answer\": 4097, \"candidate\": 77, \"answer_feedback\": \"Since you haven’t prepared for this strategy, this doesn’t help you. Overall, Scholz wins the debate.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5098, \"fields\": {\"answer\": 4098, \"candidate\": 77, \"answer_feedback\": \"Habeck criticises you sharply, but you refute him quite well. Overall, you win the debate.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5099, \"fields\": {\"answer\": 4099, \"candidate\": 77, \"answer_feedback\": \"This somewhat works, though the CSU has also put out some costly proposals in the past, which dampens the effectiveness of this strategy. Overall, Scholz wins the debate.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5100, \"fields\": {\"answer\": 4100, \"candidate\": 77, \"answer_feedback\": \"You are popular in Bavaria, though historically, Germany didn’t like to vote for CSU candidates in federal elections. Overall, Scholz wins the debate.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5101, \"fields\": {\"answer\": 4101, \"candidate\": 77, \"answer_feedback\": \"You come across as unprepared and overly aggressive. This doesn’t help you at all and overall, Scholz wins the debate.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5102, \"fields\": {\"answer\": 4102, \"candidate\": 77, \"answer_feedback\": \"This will help you keep the right wing of your party in line. Good luck tonight!\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5103, \"fields\": {\"answer\": 4103, \"candidate\": 77, \"answer_feedback\": \"The outgoing chancellor herself is still very popular, so this should rally some voters.  Good luck tonight!\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5104, \"fields\": {\"answer\": 4104, \"candidate\": 77, \"answer_feedback\": \"Hopefully this will keep the AfD in line.  Good luck tonight!\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5105, \"fields\": {\"answer\": 4105, \"candidate\": 77, \"answer_feedback\": \"He’s still bitter about the way you captured the nomination from him and only agrees to one campaign event. Good luck tonight!\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5106, \"fields\": {\"answer\": 4106, \"candidate\": 77, \"answer_feedback\": \"This worked, and winning the majority of the CDU to your side shows how strong your support is. Laschet and the party accept the vote and prepare to support you in the general election now.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5107, \"fields\": {\"answer\": 4107, \"candidate\": 77, \"answer_feedback\": \"Eventually, after days of pressure, Laschet withdraws his candidacy. However, there are a lot of bitter feelings about your accusations, and many in the CDU are very unenthusiastic about supporting you.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5108, \"fields\": {\"answer\": 4108, \"candidate\": 77, \"answer_feedback\": \"A lot of them buy this argument, but sadly, not enough are convinced. Laschet narrowly wins the vote and you have to watch from Bavaria as he tries to become chancellor.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5109, \"fields\": {\"answer\": 4109, \"candidate\": 77, \"answer_feedback\": \"While the vote is close, in the end, you come out victorious. Laschet accepts the vote and both of you can move on to focus on the upcoming campaign. This still ordeal still damaged your image, though.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5110, \"fields\": {\"answer\": 4110, \"candidate\": 77, \"answer_feedback\": \"Unfortunately, this didn’t work out and Laschet becomes the chancellor candidate. Maybe you should have done more to convince people within the party…\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5111, \"fields\": {\"answer\": 4111, \"candidate\": 77, \"answer_feedback\": \"It seems that the party is wholly behind Laschet and barely anyone buys your argument. Maybe you should have done more to convince people in the party…\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5112, \"fields\": {\"answer\": 4112, \"candidate\": 77, \"answer_feedback\": \"A lot of them buy this argument, but sadly, not enough are convinced. Laschet narrowly wins the vote and you have to watch from Bavaria as he tries to become chancellor.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5113, \"fields\": {\"answer\": 4113, \"candidate\": 77, \"answer_feedback\": \"While the vote is close, in the end, you come out victorious. Laschet accepts the vote and both of you can move on to focus on the upcoming campaign. This still ordeal still damaged your image, though.\"}}]");
